// Refactored
func alternatingCharacters(s: String) -> Int {

    var finalS = s

    while finalS.contains("AA") || finalS.contains("BB") {
        finalS = finalS.replacingOccurrences(of: "AA", with: "A")
        finalS = finalS.replacingOccurrences(of: "BB", with: "B")
    }
    return s.count - finalS.count
}

alternatingCharacters(s: "AAAA") // 3
alternatingCharacters(s: "ABABABAB") // 0
alternatingCharacters(s: "BABABA") // 0
alternatingCharacters(s: "") // 49996

